<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-une-fonction">Créer une fonction</a>
</h1>
<div class="Section6"><br>Une <b>fonction </b>est un bloc d'instructions destiné à réaliser une tâche bien précise.
<br><br><span class="GText2" style="
color: #00ff00;
">// rdv_arduino.ino (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
int LED_PIN = 13;

void setup() {
  LedFlash_Init();
}

void loop() {
  LedFlash_Run();
}

void LedFlash_Init() {
  pinMode(LED_PIN, OUTPUT);
}

void LedFlash_Run() {
  digitalWrite(LED_PIN, HIGH);
  delay(500);
  digitalWrite(LED_PIN, LOW);
  delay(500);
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-module">Créer un module</a>
</h1>
<div class="Section6"><br>Un <b>module </b>est un ensemble de fonctionnalités réutilisable écrit dans un fichier séparé.
<br><br><span class="GText2" style="
color: #00ff00;
">// Arduino (Créer un module)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu Tab
Cliquer sur les 3 points (...) &gt; New Tab
# définir le nom du fichier
Name for new file &gt; rdv_led_flash.h &gt; OK
Name for new file &gt; rdv_led_flash.cpp &gt; OK
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_arduino.ino (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_led_flash.h"

void setup() {
  LedFlash_Init();
}

void loop() {
  LedFlash_Run();
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_led_flash.h (Gestion du clignotement)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#ifndef _rdv_led_flash_
#define _rdv_led_flash_

#include &lt;Arduino.h&gt;

void LedFlash_Init();
void LedFlash_Run();

#endif
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_led_flash.cpp (Gestion du clignotement)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_led_flash.h"

int LED_PIN = 13;

void LedFlash_Init() {
  pinMode(LED_PIN, OUTPUT);
}

void LedFlash_Run() {
  digitalWrite(LED_PIN, HIGH);
  delay(500);
  digitalWrite(LED_PIN, LOW);
  delay(500);
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-une-classe">Créer une classe</a>
</h1>
<div class="Section6"><br>Une <b>classe </b>est une structure destinée à encapsuler les propriétés et les fonctionnalités associées à un objet.
<br><br><span class="GText2" style="
color: #00ff00;
">// rdv_arduino.ino (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_led_flash.h"

cLedFlash oLedFlah(13, 500);

void setup() {
  oLedFlah.init();
}

void loop() {
  oLedFlah.run();
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_led_flash.h (Gestion du clignotement)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#ifndef _rdv_led_flash_
#define _rdv_led_flash_

#include &lt;Arduino.h&gt;

class cLedFlash {
public:
  cLedFlash(int _led, int _delay_ms);
  ~cLedFlash();
  void init();
  void run();

private:
  int m_led;
  int m_delay_ms;
};

#endif
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_led_flash.cpp (Gestion du clignotement)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_led_flash.h"

cLedFlash::cLedFlash(int _led, int _delay_ms)
  : m_led(_led),
    m_delay_ms(_delay_ms) {
}

cLedFlash::~cLedFlash() {
}

void cLedFlash::init() {
  pinMode(m_led, OUTPUT);
}

void cLedFlash::run() {
  digitalWrite(m_led, HIGH);
  delay(m_delay_ms);
  digitalWrite(m_led, LOW);
  delay(m_delay_ms);
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="travailler-avec-les-ports-serie">### Travailler avec les ports série</a>
</h1>
<div class="Section6"><br>Un <b>port série</b> est un moyen de communiquer avec un système par liaison série à travers 2 fils (TXD, RXD). Il permet d'établir la communication entre 2 systèmes connectés par liaison série. Il est utilisé dans le milieu industriel pour remplacer la quantité de câbles générés autrefois par l'utilisation des ports parallèles.
<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="ecrire-sur-un-port-serie-uart">Ecrire sur un port série</a>
</h1>
<div class="Section6"><br><span class="GText2" style="
color: #00ff00;
">// rdv_arduino.ino (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_serial_port.h"

cSerialPort oSerialPort(9600);

void setup() {
  oSerialPort.init();
  oSerialPort.writeData("OK: Demarrage du systeme...");
}

void loop() {
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_serial_port.h (Gestion du port série)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#ifndef _rdv_serial_port_
#define _rdv_serial_port_

#include &lt;Arduino.h&gt;
#include &lt;WString.h&gt;

class cSerialPort {
public:
  cSerialPort(int _bauds);
  ~cSerialPort();
  void init();
  void writeData(const String&amp; _data);

private:
  int m_bauds;
};

#endif
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_serial_port.cpp (Gestion du port série)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_serial_port.h"

cSerialPort::cSerialPort(int _bauds)
  : m_bauds(_bauds) {
}

cSerialPort::~cSerialPort() {;
}

void cSerialPort::init() {
  Serial.begin(m_bauds);
}

void cSerialPort::writeData(const String&amp; _data) {
  Serial.println(_data);
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="lire-un-port-serie">Lire un port série</a>
</h1>
<div class="Section6"><br><span class="GText2" style="
color: #00ff00;
">// rdv_arduino.ino (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_serial_port.h"

cSerialPort oSerialPort(9600);

void setup() {
  oSerialPort.init();
  oSerialPort.writeData("OK: Demarrage du systeme...");
}

void loop() {
  char oChar;
  if (oSerialPort.readData(oChar)) {
    if (oChar == 'a') {
      oSerialPort.writeData("OK: Commande: " + String(oChar));
    } else if (oChar == 'b') {
      oSerialPort.writeData("OK: Commande: " + String(oChar));
    } else {
      oSerialPort.writeData("KO: Commande invalide: " + String(oChar));
    }
  }
}
