color: #00ff00;
">// rdv_serial_port.cpp (Gestion du port série)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
#include "rdv_serial_port.h"

cSerialPort::cSerialPort(int _bauds)
  : m_bauds(_bauds) {
}

cSerialPort::~cSerialPort() {;
}

void cSerialPort::init() {
  Serial.begin(m_bauds);
}

void cSerialPort::writeData(const String&amp; _data) {
  Serial.println(_data);
}

bool cSerialPort::readData(char&amp; _data) {
  if (Serial.available()) {
    _data = Serial.read();
    return true;
  }
  return false;
}

bool cSerialPort::readData(String&amp; _data) {
  if (Serial.available()) {
    _data = Serial.readString();
    return true;
  }
  return false;
}
